INSERT INTO `movies` VALUES (10,'Attack on Titan',12,20,'Attack on Titan là một bộ anime/manga Nhật Bản, nói về một thế giới nơi loài người sống trong thành phố được bảo vệ bởi các tường khổng lồ để tránh sự tấn công của những con quái vật khổng lồ gọi là \"Titan\". Nhân vật chính của câu chuyện là Eren Yeager, Mikasa Ackerman và Armin Arlert, những người sống sót sau khi một Titan khổng lồ xuất hiện và phá hủy tường bảo vệ thành phố của họ.',NULL,0,1,100000,'2023-03-17 15:00:02',NULL,NULL,0),(11,'Blood C',1,12,NULL,NULL,0,2,10000,'2023-03-17 15:23:06',NULL,NULL,0),(14,'Date a live',12,20,NULL,NULL,0,2,100000,'2023-03-18 13:19:20',NULL,NULL,0),(15,'The Queen\'s Gambit',7,15,'Bộ phim nói về Beth Harmon, một thiếu nữ mồ côi được nhận nuôi và trở thành một đại kiện tướng cờ vua.','The Queen\'s Gambit is a series about Beth Harmon, an orphan who is adopted and becomes a chess prodigy.',0,1,0,'2023-03-18 17:08:40',NULL,NULL,0),(16,'Squid Game',9,22,'Squid Game là một chương trình truyền hình tâm lý xã hội Hàn Quốc về một nhóm người tham gia một trò chơi giành giải thưởng lớn nhưng phải đối mặt với những hậu quả đáng sợ.','Squid Game is a South Korean social psychological television series about a group of people who participate in a game for a large prize but have to face terrifying consequences.',0,2,0,'2023-03-18 17:08:40',NULL,NULL,0),(17,'Friends',16,90,'Friends là một chương trình truyền hình sitcom Mỹ về một nhóm bạn thân sống tại thành phố New York.','Friends is an American sitcom television series about a group of close friends living in New York City.',0,2,0,'2023-03-18 17:08:40',NULL,NULL,0),(18,'Game of Thrones',5,20,'Game of Thrones là một chương trình truyền hình giả tưởng Mỹ về những cuộc chiến chính trị, gia đình và sức mạnh trong một thế giới hư cấu.','Game of Thrones is an American fantasy television series about the political, familial, and power struggles in a fictional world.',0,1,0,'2023-03-18 17:08:40',NULL,NULL,0),(19,'Breaking Bad',7,18,'Breaking 