agyu Kumo sáng tác và Kannatsuki Noboru minh họa. Được xuất bản bởi SB Creative dưới ấn hiệu GA Bunko. Bộ truyện có ba bản manga chuyển thể. Một mùa anime truyền hình chuyển thể bởi studio White Fox, phát sóng từ tháng 10 đến tháng 12 năm 2018.','Goblin Slayer is a series of dark fantasy light novels written by Kagyu Kumo and illustrated by Kannatsuki Noboru. It is published by SB Creative under their GA Bunko imprint. The series has been adapted into three manga adaptations and an anime television series produced by White Fox, which aired from October to December 2018.',0,1,0,'2023-04-17 20:43:25',NULL,NULL,0),(41,'Goblin Slayer',0,15,'Goblin Slayer là loạt light novel thuộc thể loại kỳ ảo đen tối do Kagyu Kumo sáng tác và Kannatsuki Noboru minh họa. Được xuất bản bởi SB Creative dưới ấn hiệu GA Bunko. Bộ truyện có ba bản manga chuyển thể. Một mùa anime truyền hình chuyển thể bởi studio White Fox, phát sóng từ tháng 10 đến tháng 12 năm 2018.','Goblin Slayer is a series of dark fantasy light novels written by Kagyu Kumo and illustrated by Kannatsuki Noboru. It is published by SB Creative under their GA Bunko imprint. The series has been adapted into three manga adaptations and an anime television series produced by White Fox, which aired from October to December 2018.',0,1,0,'2023-04-30 06:05:55',NULL,NULL,0),(42,'Goblin Slayer',0,15,'Goblin Slayer là loạt light novel thuộc thể loại kỳ ảo đen tối do Kagyu Kumo sáng tác và Kannatsuki Noboru minh họa. Được xuất bản bởi SB Creative dưới ấn hiệu GA Bunko. Bộ truyện có ba bản manga chuyển thể. Một mùa anime truyền hình chuyển thể bởi studio White Fox, phát sóng từ tháng 10 đến tháng 12 năm 2018.','Goblin Slayer is a series of dark fantasy light novels written by Kagyu Kumo and illustrated by Kannatsuki Noboru. It is published by SB Creative under their GA Bunko imprint. The series has been adapted into three manga adaptations and an anime television series produced by White Fox, which aired from October to December 2018.',0,1,0,'2023-04-30 06:07:29',NULL,NULL,0),(43,'Goblin Slayer',0,12,'Goblin Slayer là loạt light novel thuộc thể loại kỳ ảo đen tối do Kagyu Kumo sáng tác và Kannatsuki Noboru minh họa. Được xuất bản bởi SB Creative dưới ấn hiệu GA Bunko. Bộ truyện có ba bản manga chuyển thể. Một mùa anime truyền hình chuyển thể bởi studio White Fox, phát sóng từ tháng 10 đến tháng 12 năm 2018.','Goblin Slayer is a series of dark fantasy light novels written by Kagyu Kumo and illustrated by Kannatsuki Noboru. It is published by SB Creative under their GA Bunko imprint. The series has been adapted into three manga adaptations and an anime television series produced by White Fox, which aired from October to December 2018.',0,1,0,'2023-04-30 06:16:27',NULL,NULL,0),(44,'Goblin Slayer',0,12,'Goblin Slayer là loạt light novel thuộc thể loại kỳ ảo đen tối do Kagyu Kumo sáng tác và Kannatsuki Noboru minh họa. Được xuất bản bởi SB Creative dưới ấn hiệu GA Bunko. Bộ truyện có ba bản manga chuyển thể. Một mùa anime truyền hình chuyển thể bởi studio White Fox, phát sóng từ tháng 10 đến tháng 12 năm 2018.','Goblin Slayer is a series of dark fantasy light novels written by Kagyu Kumo and illustrated by Kannatsuki Noboru. It is published by SB Creative under their GA Bunko imprint. The series has been adapted into three manga adaptations and an anime television series produced by White Fox, which aired from October to December 2018.',0,1,0,'2023-04-30 06:23:13',NULL,NULL,0),(45,'Goblin Slayer',5,12,'Goblin Slayer là loạt light novel thuộc thể loại kỳ ảo đen tối do Kagyu Kumo sáng tác và Kannatsuki Noboru minh họa. Được xuất bản bởi SB Creative dưới ấn hiệu GA Bunko. Bộ truyện có ba bản manga chuyển thể. Một mùa anime truyền hình chuyển thể bởi studio White Fox, phát sóng từ tháng 10 đến tháng 12 năm 2018.','Goblin Slayer is a series of dark fantasy light novels written by Kagyu Kumo and illustrated by Kannatsuki Noboru. It is published by SB Creative under their GA Bunko imprint. The series has been adapted into three manga adaptations and an anime television series produced by White Fox, which aired from October to December 2018.',0,1,0,'2023-04-30 06:31:38',NULL,NULL,0),(46,'Blood C',1,12,'Khởi đầu của series Blood là movie Blood: The Last Vampire, nguyên tác bởi Oishii Mamoru (GiTS, The Sky Crawlers) và kịch bản bởi Kamiyama Kenji (GiTS: Stand Alone Complex, Higashi no Eden), nhân vật chính là Otonashi Saya 1 cô gái bí ẩn có khả năng tiêu diệt giống dơi quỷ hút máu còn gọi là \"Teropterid\". Movie này sau đó đã được dựng thành TV series Blood như chúng ta đã biết, nhân vật chính vẫn là Saya nhưng nội dung đã được mở rộng, xoay quanh nguồn gốc của cô, cuộc chiến giữa giống dơi quỷ (trong tv series hình như gọi là chiropteran) và con người trên thế giới, giữa 2 dòng tộc Goldschmidt và Goldsmith, và giữa Saya cùng đứa em gái sinh đôi Diva. Trong series mới này, ngoại trừ nhân vật chính Saya, cốt truyện và toàn bộ các nhân vật phụ đều thay đổi.','The beginning of the Blood series is the movie Blood: The Last Vampire, written by Oishii Mamoru (GiTS, The Sky Crawlers) and written by Kamiyama Kenji (GiTS: Stand Alone Complex, Higashi no Eden), the main character is Otonashi Saya 1 The mysterious girl has the ability to destroy the blood-sucking vampire bat species called \"Teropterid\". This movie was later made into the TV series Blood as we know it, the main character is still Saya, but the content has been expanded, revolving around her origin, the war between the demon bats (in the tv series it seems. called chiropteran) and the people of the world, between the Goldschmidt and Goldsmith clans, and between Saya and her twin sister Diva. In this new series, except for the main character Saya, the plot and all the supporting characters have changed.',0,1,0,'2023-04-30 06:41:07',NULL,NULL,0),(47,'Date A Live',3,14,'Trước khi tận thế , hãy giết hoặc hôn em đi ,30 năm trước một hiện tượng kỳ lạ được gọi là \"không gian chấn\" đã tàn phá trung tâm của lục địa Á-Âu, đe dọa mạng sống của ít nhất 150 triệu người. Từ đó, những trận không chấn nhỏ hơn đã làm thế giới trở nên bất thường.Itsuka Shidou là một học sinh trung học bình thường. Thế nhưng, trong ngày đầu tiên đi học trở lại sau kỳ nghỉ xuân, một đợt không gian chấn giáng xuống thành phố. Shidou, đi tìm em gái trong thiên tai, đã gặp gỡ một cô gái cầm trọng kiếm sau một cơn không gian chấn.Em gái của Shidou, Kotori, sau đó tiết lộ với cậu cô gái đó là một sinh vật gọi là tinh linh và là nguyên nhân gây ra các đợt không gian chấn. Đồng thời Kotori cũng tiết lộ mình là một trong những lãnh đạo của tổ chức Ratatoskr có nhiệm vụ ngăn chặn những hiểm họa tinh linh. Sau đó cô mời Shidou gia nhập tổ chức với nhiệm vụ phong ấn năng lượng của các tinh linh. Với điều kiện tiên quyết là cậu phải hẹn hò với các cô gái và khiến họ yêu cậu.','Before the apocalypse, kill or kiss me 30 years ago, a strange phenomenon known as \"space quake\" ravaged the center of Eurasia, threatening the lives of at least 150 million people. . Since then, smaller earthquakes have made the world abnormal. Itsuka Shidou is an ordinary high school student. However, on the first day back to school after spring break, a spacequake hits the city. Shidou, searching for his sister during the disaster, met a girl wielding a heavy sword after a space quake. Shido\'s younger sister, Kotori, later revealed to him that the girl was a being called a spirit. and is the cause of space earthquakes. At the same time, Kotori also reveals herself to be one of the leaders of the Ratatoskr organization whose mission is to prevent spiritual dangers. She then invites Shidou to join the organization with the task of sealing the energy of the spirits. With the precondition that he must date girls and make them fall in love with him.',0,2,30000,'2023-04-30 06:46:20',NULL,NULL,0),(48,'Goblin Slayer',0,15,'Goblin Slayer là loạt light novel thuộc thể loại kỳ ảo đen tối do Kagyu Kumo sáng tác và Kannatsuki Noboru minh họa. Được xuất bả